package com.example.vivu.fragment;

import android.content.Context;
import android.os.Bundle;
import android.util.Log;
import android.view.LayoutInflater;
import android.view.View;
import android.view.ViewGroup;
import android.widget.Toast;

import androidx.annotation.NonNull;
import androidx.annotation.Nullable;
import androidx.fragment.app.Fragment;
import androidx.recyclerview.widget.LinearLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import com.example.vivu.R;
import com.example.vivu.adapters.AdapterReviewHome;
import com.example.vivu.adapters.AdapterTendencyHome;
import com.example.vivu.models.Review;
import com.example.vivu.models.Tendency;

import java.util.ArrayList;
import java.util.List;

public class HomeFragment extends Fragment {

    private RecyclerView mRecyclerViewTendency;
    private RecyclerView mRecyclerViewReview;
    private AdapterReviewHome mAdapterReviewHome;
    private AdapterTendencyHome mAdapterTendencyHome;
    private Context mContext;
    private List<Tendency> tendencyList = new ArrayList<>();
    private List<Review> reviewList = new ArrayList<>();

    @Nullable
    @org.jetbrains.annotations.Nullable
    @Override
    public View onCreateView(@NonNull @org.jetbrains.annotations.NotNull LayoutInflater inflater, @Nullable @org.jetbrains.annotations.Nullable ViewGroup container, @Nullable @org.jetbrains.annotations.Nullable Bundle savedInstanceState) {

        View view = inflater.inflate(R.layout.fragment_home, container, false);
        mRecyclerViewTendency = view.findViewById(R.id.rcTendencyHome);
        mRecyclerViewReview = view.findViewById(R.id.rcReviewHome);
        renderData();

        mAdapterReviewHome = new AdapterReviewHome(getContext(), reviewList);
        setAdapterReviewHome(mAdapterReviewHome, mRecyclerViewReview);

        mAdapterTendencyHome = new AdapterTendencyHome(getContext(), tendencyList);
        setAdapterTendency(mAdapterTendencyHome, mRecyclerViewTendency);

        return view;


    }

    public void setAdapterReviewHome(AdapterReviewHome reviewHome, RecyclerView recyclerView) {
        LinearLayoutManager manager = new LinearLayoutManager(requireContext(),
                RecyclerView.HORIZONTAL, false);
        recyclerView.setAdapter(reviewHome);
        recyclerView.setLayoutManager(manager);
    }

    public void setAdapterTendency(AdapterTendencyHome tendencyHome, RecyclerView recyclerView) {
        LinearLayoutManager layoutManager = new LinearLayoutManager
                (requireContext(), RecyclerView.HORIZONTAL, false);
        recyclerView.setAdapter(tendencyHome);
        recyclerView.setLayoutManager(layoutManager);

    }

    public void renderData() {
        Tendency tendency = new Tendency();
        tendency.setCityName("Sai gon");
        tendency.setImagesCity("data:image/webp;base64,");
        tendencyList.add(tendency);
        Tendency tendency1 = new Tendency();
        tendency1.setCityName("Hue");
        tendency1.setImagesCity("data:image/webp;base64,");

        tendencyList.add(tendency1);
        Tendency tendency3 = new Tendency();
        tendency3.setCityName("Da Lat");
        tendency3.setImagesCity("data:image/webp;base64,");
        tendencyList.add(tendency3);
        Tendency tendency4 = new Tendency();
        tendency4.setCityName("Hoi An");
        tendency4.setImagesCity("data:image/webp;base64,");

        tendencyList.add(tendency4);

        Review review = new Review("Cau rong Da Nang", "day la detail", "data:image/webp;base64,");
        reviewList.add(review);
        Review review1 = new Review("Da Lat yeu", "", "data:image/webp;base64,");

        reviewList.add(review1);
    }


}
